// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";

/*
    Контракт с помощью которого работает фугкционал чата
    Владельцем этого контракта является ChatRoomFinance

    Что сделано:
    1 сообщения сохраняются
    2 при отправки сообщения вызывается функция которая принимает оплату из СhatRoomFinance
    3 получение количества сообщений
    4 получение сообщения по индексу

    Что необходимо сделать:
    1 получать сообщения конкретного пользователя
    ...
*/
interface ChatRoomFinanceInterface {
    function processPayment(uint256 ownerCommissionPercent) external payable;
}

contract ChatRoom is Ownable, Pausable {
    //Котракт , который отвечает за менеджмент чата
    address public chatRoomFinance;

    // Структура для хранения информации о сообщении
    struct Message {
        address sender;
        string content;
        uint256 timestamp;
    }

    // Список всех сообщений в чате
    Message[] public messages;

    // Список индексов сообщений по пользователю
    mapping(address => uint256[]) public userMessages;

    // Событие для отслеживания отправленных сообщений
    event MessageSent(
        address indexed sender,
        string content,
        uint256 timestamp
    );

    // Инициализация контракта с указанием стоимости сообщения
    constructor(address _chatRoomFinance) Ownable(_chatRoomFinance) {
        require(
            _chatRoomFinance != address(0),
            "ChatRoomFinance address cannot be zero."
        );
        chatRoomFinance = _chatRoomFinance;
    }

    // Функция для отправки сообщения в чат
    function sendMessage(string memory content, uint256 ownerCommissionPercent)
        public
        payable
        whenNotPaused
    {
        // Безопасный вызов ChatRoomFinance для обработки платежа и распределения средств
        ChatRoomFinanceInterface(chatRoomFinance).processPayment{
            value: msg.value
        }(ownerCommissionPercent);

        // Добавление сообщения в массив и получение его индекса
        messages.push(
            Message({
                sender: msg.sender,
                content: content,
                timestamp: block.timestamp
            })
        );
        uint256 messageIndex = messages.length - 1;

        // Сохранение индекса сообщения в массиве индексов для отправителя
        userMessages[msg.sender].push(messageIndex);

        emit MessageSent(msg.sender, content, block.timestamp);
    }

    // Функция для получения количества сообщений в чате
    function getMessageCount() public view returns (uint256) {
        return messages.length;
    }

    // Функция для чтения конкретного сообщения по индексу
    function getMessageByIndex(uint256 index)
        public
        view
        returns (
            address,
            string memory,
            uint256
        )
    {
        require(index < messages.length, "Message index out of bounds");
        Message storage message = messages[index];
        return (message.sender, message.content, message.timestamp);
    }

    // Function to get indexes of all user messages
    function getUserMessageIndexes(address user)
        public
        view
        returns (uint256[] memory)
    {
        return userMessages[user];
    }

    // Функция для получения всех сообщений пользователя
    function getUserMessages(address user)
        public
        view
        returns (Message[] memory)
    {
        uint256[] memory indexes = userMessages[user];
        Message[] memory userMsgs = new Message[](indexes.length);

        for (uint256 i = 0; i < indexes.length; i++) {
            userMsgs[i] = messages[indexes[i]];
        }

        return userMsgs;
    }

    // Функция для чтения сообщения пользователя по индексу его сообщений
    function getUserMessageByIndex(address user, uint256 messageIndex)
        public
        view
        returns (Message memory)
    {
        require(
            messageIndex < userMessages[user].length,
            "User message index out of bounds"
        );

        uint256 globalIndex = userMessages[user][messageIndex];
        require(
            globalIndex < messages.length,
            "Global message index out of bounds"
        );

        return messages[globalIndex];
    }

    // Функция возвращает последние N сообщений из чата и индекс для следующей загрузки
    function getLastNMessages(uint256 n)
        public
        view
        returns (Message[] memory, uint256)
    {
        uint256 totalMessages = messages.length;
        uint256 nextIndex = 0; // Если сообщений нет, следующего индекса нет
        if (n > totalMessages) {
            n = totalMessages;
        } else {
            nextIndex = totalMessages - n; // Следующий индекс для запроса более старых сообщений
        }

        Message[] memory lastNMessages = new Message[](n);
        for (uint256 i = 0; i < n; i++) {
            lastNMessages[i] = messages[totalMessages - n + i];
        }

        return (lastNMessages, nextIndex);
    }

    // Функция возвращает сообщения начиная с индекса start до start + n и следующий индекс
    function getMessagesFromIndex(uint256 start, uint256 n)
        public
        view
        returns (Message[] memory, uint256)
    {
        uint256 totalMessages = messages.length;
        require(start < totalMessages, "Start index out of bounds.");

        if (start + n > totalMessages) {
            n = totalMessages - start;
        }
        uint256 nextIndex = start + n < totalMessages ? start + n : 0; // Если достигнут конец, следующего индекса нет

        Message[] memory messagesBatch = new Message[](n);
        for (uint256 i = 0; i < n; i++) {
            messagesBatch[i] = messages[start + i];
        }

        return (messagesBatch, nextIndex);
    }
}

